import {
    container as stlye_container
} from './index.module.css';

const FilmCard = ({
    title,
    index
}) => {
    return <div
        key={'films-' + index}
        className={stlye_container}
    >
        <span className="postTitle">{title}</span>
        <p className="" />
    </div>
};
export default FilmCard;
